sys_variable_value.value:
(function execute(inputs, outputs) {
  var dupUiAction = new GlideRecord("sys_ui_action");
  dupUiAction.addQuery("action_name", "data_mining_ops");
  dupUiAction.addQuery("table", inputs['table_name']);
  dupUiAction.addQuery("list_banner_button", true);
  dupUiAction.setLimit(1);
  dupUiAction.query();
  if(dupUiAction.next()){
    if(dupUiAction.active){
      outputs['enableresult'] = "failed";
    }else{
      dupUiAction.active = true;
      dupUiAction.update();
      outputs['enableresult'] = "passed";
    }
  }else{
    var uiAction = new GlideRecord("sys_ui_action");
    uiAction.addQuery("action_name", "data_mining_ops");
    uiAction.addQuery("table", "u_data_mining");
    uiAction.addQuery("list_banner_button", true);
    uiAction.setLimit(1);
    uiAction.query();
    if(uiAction.next()){
      uiAction.table = inputs['table_name'];
      uiAction.active = true;
      uiAction.insert();
      outputs['enableresult'] = "passed";
    }
  }
})(inputs, outputs);

